import React from 'react';
import Container from '../../common/Container/Container';
import MainSlider from '../../components/MainSlider/MainSlider';
import Intro from '../../components/Intro/Intro';
import Info from '../../components/Info/Info';
import DiscoverStory from '../../components/DiscoverStory/DiscoverStory';
import DiscoverMenu from '../../components/DiscoverMenu/DiscoverMenu';
import Testimony from '../../components/Testimony/Testimony';
import DiscoverCoffee from '../../components/DiscoverCoffee/DiscoverCoffee';
import Gallery from '../../components/Gallery/Gallery';
import Form from '../../components/Form/Form';
import Fade from 'react-reveal/Fade';
import { slides } from '../../content/slides';
import { services } from '../../content/services';
import { coffee } from '../../content/coffee';

const Homepage = () => (
  <Container className="homepage">
    <MainSlider slides={slides} />
    <Intro />
    <DiscoverStory />
    <Info info={services} colorDescription="black" colorTitle="black" />
    <DiscoverMenu />
    <Info
      info={coffee}
      variant="image"
      colorDescription="grey"
      colorTitle="twine"
    />
    <DiscoverCoffee />
    <Testimony />
    <Fade>
      <Form />
    </Fade>

    <Gallery />
  </Container>
);

export default Homepage;
